/** 
 * Show/hide SOAP/MQ details section, based on "Callout Type" type value 
 */ 
function setSectionVisibility(){	 
	var mode=""; 
	if(dijit.byId("CalloutPortletmainPageMode_field")!=undefined) 
		mode=dijit.byId("CalloutPortletmainPageMode_field").value; 
	dojo.addClass("CalloutPortletmainPageSOAPSection","celeritiHide"); 
	dojo.addClass("CalloutPortletmainPageMQSection","celeritiHide"); 
	dojo.addClass("CalloutPortletmainPageIsIFXSection","celeritiHide"); 
	if(dojo.byId("CalloutPortletmainPageCalloutType_field").value == "SOAP"){ 
		clearMQSection(); 
		if(mode=="Start" || mode=="Edit"){ 
			var radioButtonList=document.getElementsByName("EndpointType");	 
				if(radioButtonList[0].checked || radioButtonList[1].checked){			 
					} else{ 
						radioButtonList[0].checked = true; 
						setEndpointVisibility(); 
					} 
			 
			 
		} 
		dojo.removeClass("CalloutPortletmainPageSOAPSection","celeritiHide"); 
		dojo.removeClass("CalloutPortletmainPageIsIFXSection","celeritiHide"); 
	}else if(dojo.byId("CalloutPortletmainPageCalloutType_field").value == "MQ"){ 
		clearSOAPSection(); 
		dojo.removeClass("CalloutPortletmainPageMQSection","celeritiHide"); 
		dojo.removeClass("CalloutPortletmainPageIsIFXSection","celeritiHide"); 
	} 
} 
 
/** 
 * Show/hide Enpoint/RegistryLookup sections, based on "Enpoint Type" value 
