	} 
} 
 
/** 
 * Set visibility of various buttons on screen based on operation mode 
 */ 
function setBtnVisibility(){		 
	var mode=""; 
	if(dijit.byId("CalloutPortletmainPageMode_field")!=undefined) 
		mode=dijit.byId("CalloutPortletmainPageMode_field").value; 
 
	if(mode=="Start"){ 
		dojo.addClass("CalloutPortletmainPageCopyCalloutButton_Span","celeritiHide"); 
