		dojo.byId("CalloutPortletmainPageSearchButton").disabled = false; 
		 
	} 
	else if(mode=="Search"){ 
		//added 
		dojo.addClass("CalloutPortletmainPageSOAPSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageIsIFXSection","celeritiHide"); 
