		dojo.addClass("CalloutPortletmainPageCopyCalloutButton_Span","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageDeleteCalloutButton_Span","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageMQSection","celeritiHide"); 
		 
		dojo.addClass("CalloutPortletmainPageShowSearchLinkSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageCalloutSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageRsCodesSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageNoRsCodesSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageResponseListDP","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageRsTransformSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageButtonsSection","celeritiHide"); 
		dojo.addClass("CalloutPortletmainPageAddRsCodeButton","celeritiHide"); 
			 
