/** 
 * This method is used to validate the RsTransRoutineName 
 */ 
function validateTransRoutineName(encDivId){ 
	var regExp = new RegExp("\\s"); 
	var dijitItem = dijit.byId("CalloutPortletmainPageRsTransRoutineName_field"); 
	var transRoutineName=dijit.byId("CalloutPortletmainPageRsTransRoutineName_field").value; 
 
	if(regExp.test(transRoutineName)){ 
		writeStatus(encDivId); 
		dijitItem.focus(); 
		return false; 
	} 
	return true; 
} 
/** 
 * This method is used to validate the input in search field 
 */ 
function validateSearchInputs(){ 
	var validInput = true; 
	var name = dijit.byId("CalloutPortletmainPageSearchCalloutName_field").attr("value"); 
	if((name==null || name=="")){ 
		alert("Search values are invalid or blank"); 
		validInput=false; 
	} 
	return validInput; 
} 
